import Dice from '../components/game/Dice';
import Hourglass from '../components/game/Hourglass';
import './GamePage.css';

const GamePage = () => {
  return (
    <div className="game-container">
       <div className="cards-zone"></div> {/* Nouvelle zone pour les cartes */}
      <div className="game-table">
        {/* Contenu futur du jeu ira ici */}
        <Dice />
        <Hourglass />
      </div>
    </div>
  );
};

export default GamePage;
